import React from 'react';

import { View, Text } from 'react-native';
import { withNavigation } from 'react-navigation-stack'; 

class HomeScreen extends React.Component {

    render() {

      return (        

        <View>

        <Text>Home</Text>
        </View>

      );

    }

} 

export default withNavigation(HomeScreen);
